function add(a,b)
{
    return a+b;
}
function sub(a,b)
{
    return a-b;
}
function mul(a,b)
{
    return a*b;
}
function div(a,b)
{
    let dr=a/b;
    dr=dr.toFixed(2);
    return dr;
}
export {add,sub,mul,div};
